script: |
  super -f text -I q3429.spq | sort > q3429.out

inputs:
  - name: q3429.spq
    data: |
      SELECT DISTINCT + + col2 - - 12 FROM tab2 (FORMAT parquet) WHERE NOT col0 * + + col2 NOT BETWEEN - col0 + - 72 * - col1 AND + col0 + + 96 + + + col1;
  - name: tab2

outputs:
  - name: q3429.out
    data: |
